import React from 'react'
import { animate, motion } from 'framer-motion'
import { type } from '@testing-library/user-event/dist/type'

const parentVariants = {
    hidden: {
         y:"-100vw"
    },
    visible:{
        y:"0" ,
        transition: {
            duration: 1.5,
        } 
    }
}

const childVariant = {
    hidden: {
         y:"100vw",
         opacity:0
    },
    visible:{
        y:"0" ,
        opacity:1,
        transition: {
            type: "spring",
            delay:5.5,
            stiffness: 90,
            duration: 2.5,
        } 
    }
}

function RightSide() {
  return (
    <motion.div className='w-1/2  bg-gradient-to-b from-blue-950 to to-blue-400'
        variants={parentVariants}
        initial ="hidden"
        animate = "visible"
    >
        <motion.div className='flex flex-col  h-full items-center justify-center'>
            <motion.div className='bg-white/90 w-3/4 h-2/4 rounded-3xl'
                variants={childVariant}
                initial ="hidden"
                animate = "visible"
            >

            </motion.div>


        </motion.div>

    </motion.div>
  )
}

export default RightSide
